import { useState, useEffect } from "react";
import * as XLSX from "xlsx";
import JurnalForm from "./components/JurnalForm.js";

function App() {
  const [jurnalList, setJurnalList] = useState([]);
  const [editIndex, setEditIndex] = useState(null);
  const [editData, setEditData] = useState(null);
  const [filterKelas, setFilterKelas] = useState("");
  const [filterTanggal, setFilterTanggal] = useState("");

  useEffect(() => {
    const dataTersimpan = localStorage.getItem("jurnalList");
    if (dataTersimpan) {
      setJurnalList(JSON.parse(dataTersimpan));
    }
  }, []);

  useEffect(() => {
    if (jurnalList.length > 0) {
      localStorage.setItem("jurnalList", JSON.stringify(jurnalList));
    }
  }, [jurnalList]);

  const tambahJurnal = (jurnalBaru) => {
    if (editIndex !== null) {
      const jurnalBaruList = [...jurnalList];
      jurnalBaruList[editIndex] = jurnalBaru;
      setJurnalList(jurnalBaruList);
      setEditIndex(null);
      setEditData(null);
    } else {
      setJurnalList([...jurnalList, jurnalBaru]);
    }
  };

  const hapusJurnal = (index) => {
    const jurnalBaru = jurnalList.filter((_, i) => i !== index);
    setJurnalList(jurnalBaru);
    localStorage.setItem("jurnalList", JSON.stringify(jurnalBaru));
  };

  const editJurnal = (index) => {
    setEditIndex(index);
    setEditData(jurnalList[index]);
  };

  const eksporKeExcel = () => {
    const ws = XLSX.utils.json_to_sheet(jurnalList);
    const wb = XLSX.utils.book_new();
    XLSX.utils.book_append_sheet(wb, ws, "Jurnal Kelas");
    XLSX.writeFile(wb, "Jurnal_Kelas.xlsx");
  };

  const jurnalTersaring = jurnalList.filter((jurnal) => {
    return (
      (filterKelas === "" || jurnal.kelas.includes(filterKelas)) &&
      (filterTanggal === "" || jurnal.tanggal === filterTanggal)
    );
  });

  return (
    <div style={{ maxWidth: "800px", margin: "auto", padding: "20px" }}>
      <h1 style={{ textAlign: "center" }}>ðŸ“– Jurnal Kelas</h1>
      <JurnalForm tambahJurnal={tambahJurnal} editData={editData} />

      <h2>Filter Jurnal</h2>
      <input
        type="text"
        placeholder="Filter berdasarkan kelas"
        value={filterKelas}
        onChange={(e) => setFilterKelas(e.target.value)}
        style={{ marginRight: "10px", padding: "5px" }}
      />
      <input
        type="date"
        value={filterTanggal}
        onChange={(e) => setFilterTanggal(e.target.value)}
        style={{ padding: "5px" }}
      />

      <h2>Daftar Jurnal</h2>
      {jurnalTersaring.length === 0 ? (
        <p>Belum ada jurnal.</p>
      ) : (
        <ul style={{ listStyle: "none", padding: 0 }}>
          {jurnalTersaring.map((jurnal, index) => (
            <li key={index} style={{ borderBottom: "1px solid #ccc", padding: "10px 0" }}>
              <strong>{jurnal.tanggal}</strong> - {jurnal.kelas} - {jurnal.guru} - {jurnal.subjek} - {jurnal.topik} - Kehadiran: {jurnal.kehadiran} - {jurnal.keterangan}
              <button onClick={() => editJurnal(index)} style={{ marginLeft: "10px", background: "blue", color: "white", padding: "5px" }}>Edit</button>
              <button onClick={() => hapusJurnal(index)} style={{ marginLeft: "10px", background: "red", color: "white", padding: "5px" }}>Hapus</button>
            </li>
          ))}
        </ul>
      )}

      <button onClick={eksporKeExcel} style={{ marginTop: "20px", background: "green", color: "white", padding: "10px", width: "100%" }}>
        ðŸ“¥ Ekspor ke Excel
      </button>
    </div>
  );
}

export default App;
